def deco(*args):
    path = os.path.join(BASE_PATH, *args)
    if not os.path.exists(path):
        if strict_data_files:
            msg = "Could not find file {} and --strict-data-files is set."
            raise ValueError(msg.format(path))
        else:
            msg = "Could not find {}."
            pytest.skip(msg.format(path))
    return path

